import React,{useState,useEffect,setState,useParams} from 'react';
import Axios from 'axios';
import '../../App.css';
import Footer from '../Footer';


function Register() {

  const [username, setUsername] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");

  
   
  const register = () => {
   Axios.post("http://localhost:5001/register", {name: username, email: email, password: password,
  })
  .then((response) => {
   console.log((response)=>{
   })
   
  })
  .catch((err)=>(err.response.data));
  
  
  };



 

  return (
    <>
    <h1 className='services' >Register</h1><br/>
   
    <div className='container' >
    
      <h1>Register Here</h1><br/>

    <input type="text"
    placeholder = "Enter Your Name" 
    onChange={(e) => {
      setUsername(e.target.value);
    }}
    
    />
    <input type="text"
    placeholder = "Enter Email" 
    onChange={(e) => {
      setEmail(e.target.value);
    }}/>

    <input type="password"
    placeholder = "Enter Password" 
     onChange={(e) => {
      setPassword(e.target.value);
    }}
    />
    <br/><br/>
    <input onClick={register} type="button" value="Register"/><br/>
    <a href = "/login" type="button">Already have an account ? &nbsp;&nbsp; Login</a>
    </div>
   
    </>
  );
}


export default Register;
